import React, { Component } from 'react';
import Button from './Button';

export default class TodoList extends Component {

  state = {
    task: '',
  }



  render() {
    return (
      <div>
        <form>
          <input placeholder="task"/>
          <Button
          text={"Enviar"}
          handleClick={this.addTask}

          />
        </form>
      </div>
    );
  }
}
